import React from 'react';
import {robots} from './robots.js';
import Card from './Card.js';

const Cardlist=()=>{
	CardArray=robots.map((obj,ind)=>{
		return(
			<Card key={ind} info={obj} />
		);
	});
	console.log(CardArray);
	return(
		<div>
			{CardArray}
		</div>
	);
}
export default Cardlist;
